  input: 'TEXT,F3XA,,"The Commission''s regulations concerning the reporting of contributor
    information for earmarked contributions received by conduits at 11 CFR Sec. 110.6(c)(iv)(A)
    states that Schedule A should only provide employer and occupation information
    if the amount of an earmarked contribution is in excess of $200.  The text of
    the regulation is as follows:  ''The name and mailing address of each contributor
    and, for each earmarked contribution in excess of $200, the contributor''s occupation
    and the name of his or her employer.''  Therefore, employer and occupation information
    for contributors who make contributions to authorized candidates in amounts less
    than $200 is not required.  "'
